// 首先使用面向对象的思维解决问题
// 1. 地图对象  ： 创建地图 并 显示 
// 2. 食物对象  ： 在地图上随机创造一个食物并显示
// 3，蛇对象    ： 构建蛇的头和身体，控制蛇的移动，控制蛇的死亡，控制蛇吃到食物后加长身体

/**
 * 
 * @param {*} dom 
 * @returns 返回元素类型 String
 */
// 判断元素类型
function determineElementType(dom) {
  return Object.prototype.toString.call(dom).slice(8, -1)
}

let bgImageBase64 = 'data:image/png;base64,'
let bodyImageBase64 = "data:image/png;base64,"
let headImageBase64 = "data:image/png;base64,"
let foodImageBase64 = "data:image/png;base64,"
/**
 * 
 * @param {Number} minNumber 
 * @param {Number} maxNumber 
 * @returns Number 一个min与max之间的随机数
 */
// 随机数的函数
function creatRandomNumber(minNumber, maxNumber) {
  if (determineElementType(minNumber) != "Number" || determineElementType(maxNumber) != "Number") {
    throw new Error("传入两个Number类型的 ok?")
  }
  return Math.floor(Math.random() * (maxNumber - minNumber + 1) + minNumber)

}


/**
 * 
 * @param {Number} xCellNumber 
 * @param {Number} yCellNumber 
 * @param {Number} cellWidth 
 * @param {Number} cellHeight 
 */
// 首先写地图的构造函数）
// 要灵活 传入地图需要的长宽
function Map(xCellNumber = 25, yCellNumber = 15, cellWidth = 20, cellHeight = 20) {
  this.xCellNumber = xCellNumber
  this.yCellNumber = yCellNumber
  this.cellWidth = cellHeight
  this.cellHeight = cellHeight
  this.mapWidth = 0
  this.mapHeight = 0
  this.mapDom = null
  this.maxEatFoodNumber = 0
  this.maxNumberDom = null
}
// 地图的初始化函数
Map.prototype.init = function () {
  if (localStorage.getItem("maxEatFoodNumber") == null) {
    localStorage.setItem("maxEatFoodNumber", 0)
  }
  this.maxEatFoodNumber = localStorage.getItem("maxEatFoodNumber") - 0
  this.mapWidth = this.xCellNumber * this.cellWidth
  this.mapHeight = this.yCellNumber * this.cellHeight
  // 创建map，并设置长度和宽度和背景图片
  this.mapDom = document.createElement("div")
  this.mapDom.classList.add("connect")
  this.mapDom.style.width = this.mapWidth + "px"
  this.mapDom.style.height = this.mapHeight + "px"
  this.mapDom.style.backgroundImage = `url("${bgImageBase64}")`
  // 添加到body上
  document.body.appendChild(this.mapDom)


  this.maxNumberDom = document.createElement("div")
  this.maxNumberDom.classList.add("max")


}


// 食物对象的构造函数
function Food(map) {
  this.map = map
  this.x = 0
  this.y = 0
  this.foodDom = null
}
//添加食物的初始化函数
Food.prototype.init = function () {

  // 这里x和y用的是格子的序号数，这样才能确保食物在格子里
  this.x = creatRandomNumber(0, this.map.xCellNumber - 1)
  this.y = creatRandomNumber(0, this.map.yCellNumber - 1)

  let foodDom = document.createElement("div")
  this.foodDom = foodDom
  console.log(this.foodDom);
  foodDom.style.background = `url("${foodImageBase64}")`
  foodDom.classList.add("food")
  foodDom.style.left = this.x * this.map.cellWidth + "px"
  foodDom.style.top = this.y * this.map.cellHeight + "px"
  foodDom.style.backgroundSize = "contain";
  this.map.mapDom.appendChild(foodDom)

}


// 创建蛇的构造函数 

function Snake(map, food) {
  this.map = map
  this.food = food
  this.direction = 68
  this.body = [
    { x: 0, y: 0, url: bodyImageBase64, isdom: false, bodyDom: null },
    { x: 1, y: 0, url: bodyImageBase64, isdom: false, bodyDom: null },
    { x: 2, y: 0, url: headImageBase64, isdom: false, bodyDom: null }

  ]
}

/**
 * 初始化蛇
 * 展示蛇
 * 监听键盘事件
 */
Snake.prototype.init = function () {
  this.show()
  this.maxNumbershow()
  let _this = this
  document.addEventListener("keydown", e => {
    _this.direction = e.keyCode
    console.log(e.keyCode);
  })
  this.timer = setInterval(() => {
    this.move()
    this.show()
  }, 500)



}

/**
 * 让蛇功根据body数组渲染出来
 */
Snake.prototype.show = function () {
  this.body.forEach(item => {

    if (!item.isdom) {
      let snakeDom = document.createElement("div")
      snakeDom.classList.add("snakeBody")
      snakeDom.style.background = `url(${item.url})`
      snakeDom.style.backgroundSize = "contain";
      this.map.mapDom.appendChild(snakeDom)
      item.isdom = true
      item.bodyDom = snakeDom
    }
    item.bodyDom.style.top = item.y * this.map.cellHeight + "px"
    item.bodyDom.style.left = item.x * this.map.cellWidth + "px"

  })
}

/**
 * 让蛇移动
 * @returns 
 */
Snake.prototype.move = function () {
  let head = this.body[this.body.length - 1]

  if (head.x + 1 > this.map.xCellNumber || head.y + 1 > this.map.yCellNumber || head.x < 0 || head.y < 0) {
    clearInterval(this.timer)
    alert('你死了')
    location.reload()
    return
  }
  this.body.forEach((item, index, arr) => {

    // 根据wasd改变蛇的移动方向
    if (index == arr.length - 1) {

      switch (this.direction) {
        case 68: item.x += 1
          break;
        case 65: item.x -= 1
          break;
        case 87: item.y -= 1
          break;
        case 83: item.y += 1
          break;
      }

    } else {
      item.x = arr[index + 1].x
      item.y = arr[index + 1].y
    }
  })
  // 迟到了food，加一个body
  if (head.x == this.food.x && head.y == this.food.y) {
    this.map.mapDom.removeChild(this.food.foodDom)
    this.food.init(this.map)
    this.body.unshift({ x: this.body[0].x, y: this.body[0].y, url: bodyImageBase64, isdom: false, bodyDom: null })
    this.maxNumbershow()
  }


}

Snake.prototype.maxNumbershow = function () {
  let nowpoint = this.body.length - 3
  let maxpoint = this.map.maxEatFoodNumber - 0
  this.map.maxNumberDom.innerHTML = `<p>最高记录是${maxpoint}</p>
      <p>现在的分 ${nowpoint}</p>
  `
  this.map.mapDom.appendChild(this.map.maxNumberDom)
  if (nowpoint > maxpoint) {
    localStorage.setItem("maxEatFoodNumber", nowpoint)
  }
}













